      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE + col1 NOT BETWEEN - col1 * + col0 + - 31 / - col2 AND - 14 * 60 + + - 40 + + 9 AND NOT NULL IS NULL;
  - name: tab0

outputs:
  - name: q7601.out
    data: |
